@GmftLa @caroceretti @fedesimonetti No voy a discutir su teoría de motorman suicida...
No sé qué tiene que ver el pro, no comparé nada.
Sólo dije que no renovaron formaciones ni estaciones hasta que no hubo muertos. Y todavía esperamos el soterramiento. Se la robaron toda le guste o no, sino estaría terminado.

La storia della suicida più bella di sempre, Evelyn McHale, che l'1 maggio del 1947 si gettò dall'86esimo piano dell'Empire State Building, in "Non sarò mai la brava moglie di nessuno" di Nadia Busato 
